År 2050 hoppas jag leva,jag är då 41 år gammal.Jag hoppas ha en familj och ett bra jobb som advokat, lärare eller något annat kul.Jag hoppas vara frisk och inte beroende av något. I världen så tror jag att kartan ser relativ lik ut men att vi kommer röra oss mindre och att vi kommer komma på mer onödiga som nödvändiga uppfinningar som t.ex en hologram telefon.Jag tror att temperaturen stiger och att vi inte får så mycket snö längre.Jag tror att vi kommer äta mer varierande mat eftersom vi typ bara äter av 25 typer av växter av 1000 tals möjliga ätbara växter. Jag tror att man kan men att det kommer vara otroligt dyrt att åka på semester till rymden/månen/mars.Världen kommer troligen att mycket mer välutveckladt och jag hoppas att vi minskar föroreningar i haven och luften.

Mer sportsligt hoppas jag att Sverige vinner en VM/EM medalj, Chelsea vinner Champions Lleague,Kalmar vinner allsvenskan och Husqvarna går upp till allsvenskan.Jag hoppas i mina vildaste drömmar att jag precis har avslutat min fotbollskarriär som internationell fotbollsmålvakts proffs.Jag hoppas ha ett bra och friskt liv 2050.
                                //Axel Bäckstrand, Husqvarna, Sverige 2021
